Text:
@chatner
In anbetracht der Tatsache, dass die meisten hier nur saugen und selbst nichts oder zumindest sehr wenig hier hochladen/sharen, wird man den Verdacht nicht los, dass fast nur Mitarbeiter von irgendwelchen sogenannten Firmen hier 'umher surfen' und ihr Unwesen treiben.
Apropos: Kittel- und Anzugträger sind mir schon immer ein Graus gewesen. Sei der Kittel nun weiß, blau oder grau, der Anzug (aal-)glatt, gestreift oder mit Gamaschen. Dreck haben eh die meisten von denen am Stecken.
